    (item) => item.date.getFullYear() === filteredYear - 0
  );

  let expenseData = <p>No Data Found</p>;
  if (filtered.length > 0) {
    expenseData = filtered.map((expense, idx) => (
      <ExpenseItem
        key={idx}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ));
  }
  return (
    <div>ExpensesList</div>
  )
}

